import React from 'react'

const DemoList = (props) => {
    const newList = [...new Set(props.items)]
    return (
        <div style={{
            listStyle: "none"
        }}>
            <h2>{props.title}</h2>
            <ul>
                {newList.map(item => <li>{item}</li>)}
            </ul>
        </div>
    )
}

export default React.memo(DemoList)
